import { Router } from 'express';
import config from '../../../config/config';
// Import Routes
import ordersRoutes from './OrdersRoutes';
const routerAPI = (app) => {
  const router = Router();
  const api = config.API_URL;
  app.use(api, router);
  // Routes
  router.use('/orders', ordersRoutes);
  // Return Router
  return router;
};
module.exports = routerAPI;

