        estatus: [{
            IdTipoEstatusOK: { type: String },
            Actual: { type: String, enum: ["S", "N"] },
            Observacion: { type: String },
            detail_row: {
                Activo: { type: String, enum: ["S", "N"] },
                Borrado: { type: String, enum: ["S", "N"] },
                detail_row_reg: [{
                    FechaReg: { type: Date },
