        }],

        rastreos: {
            NumeroGuia: { type: String },
            IdRepartidorOK: { type: String },
            NombreRepartidor: { type: String },
            Alias: { type: String },
            seguimiento: [{
                Ubicacion: { type: String },
                DesUbicacion: { type: String },
